import React from "react";

function CoinComponent({ coin, index }) {
  console.log(coin);

  return <tr className="coin_component" key={index}>
        <td><img src={coin.iconUrl} alt=""/>{coin.name}</td>
        <td>{coin.price}</td>
        <td>{coin.change}</td>
        <td>{coin["24hVolume"]}</td>
        <td>{coin.rank}</td>
  </tr>;
}

export default CoinComponent;
